sdApp.controller('PE_LocalStorageCtrl', function ($scope) {

    $scope.enableTab_Actions = function () {
        $scope.tab = 1;
        $scope.stringForTitle = 'LocalStorage - Actions';
        $scope.stringForRightButton = 'ACT';
    }

    $scope.enableTab_List = function () {
        $scope.tab = 2;
        $scope.stringForTitle = 'LocalStorage - List';
        $scope.stringForRightButton = 'LST';
    }

    $scope.enableTab_Edit = function () {
        $scope.tab = 3;
        $scope.stringForTitle = 'LocalStorage - Edit';
        $scope.stringForRightButton = 'EDIT';
    }

    $scope.enableTab_Perf = function () {
        $scope.tab = 4;
        $scope.stringForTitle = 'LocalStorage - Perf';
        $scope.stringForRightButton = 'PER';
    }

    $scope.enableTab_Image = function () {
        $scope.tab = 5;
        $scope.stringForTitle = 'LocalStorage - Image';
        $scope.stringForRightButton = 'IMG';
    }

    $scope.enableTab_List2 = function () {
        $scope.tab = 6;
        $scope.stringForTitle = 'LocalStorage - List2';
        $scope.stringForRightButton = 'LST2';
    }

    $scope.localStorage = [];
    $scope.localStorage = localStorage;

    $scope.myOverlayTitle = 'title';
    $scope.myOverlayText = 'text';

    $scope.test = function () {
        alert(JSON.stringify($scope.localStorage));
    };


    $scope.saveOneItem = function () {
        localStorage.setItem('test', 'foo');
        alert('variable test set to foo');
    };

    $scope.loadOneItem = function () {
        alert('test: ' + localStorage.getItem('test'));
    };

    $scope.perf_store100Items = function () {

        var start = new Date().getTime();

        for (i = 0; i < 100; ++i) {

            localStorage.setItem(('test' + i), 'test' + i);

        }

        var end = new Date().getTime();
        var time = end - start;
        alert('Execution time: ' + time);

        for (i = 0; i < 100; ++i) {

            localStorage.removeItem(('test' + i));

        }

    };

    $scope.perf_store1000Items = function () {

        var start = new Date().getTime();

        for (i = 0; i < 1000; ++i) {

            localStorage.setItem(('test' + i), 'test' + i);

        }

        var end = new Date().getTime();
        var time = end - start;
        alert('Execution time: ' + time);

        for (i = 0; i < 1000; ++i) {

            localStorage.removeItem(('test' + i));

        }

    };

    $scope.perf_store10times1000 = function () {

        time = [];

        for (i = 0; i < 10; ++i) {

            var start = new Date().getTime();
            for (k = 0; k < 1000; ++k) {

                localStorage.setItem(('test' + k), 'test' + k);

            }
            var end = new Date().getTime();
            //var time = end - start;
            time.push(end - start);
            //alert(end - start);


            for (m = 0; m < 1000; ++m) {

                localStorage.removeItem(('test' + m));

            }
        }

        //alert('Execution time: ' + time);
        $scope.timeString = time.join(",");

        //  $scope.timeString = 'foo';
    };


    $scope.loadImage = function () {

        var hero;

        if (localStorage.getItem('heroImg')) {
            hero = localStorage.getItem('heroImg');
        }
        else {
            hero = '';
            localStorage.setItem('heroImg', hero);
        }

        document.getElementById("hero-graphic").src = 'data:image/png;base64,' + hero;

    };

    $scope.showAlert = function (text) {
        alert(text);
        ;
    };

    $scope.openOverlay = function (title, text) {
        $scope.myOverlayTitle = 'key: ' + title;
        $scope.myOverlayText = 'value: ' + text;
        //$scope.myOverlayText = text;
        $scope.toggle('myOverlay', 'on');
    };

    $scope.enableTab_Actions();


});